Alignment of the declaration for socket.close () callback function in dgram module.
According to the source of nodjs dgram module (lines: 420-435):  
https://github.com/nodejs/node/blob/master/lib/dgram.js

``` JavaScript
  this._healthCheck();
  this._stopReceiving();
  this._handle.close();
  this._handle = null;
  process.nextTick(socketCloseNT, this);

  return this;
};

function socketCloseNT(self) {
  self.emit('close');
}
```

React `fontWeight` was not accepting `"initial"`, `"inherit"` and `"unset"`.

These are the CSS 3 explicit defaulting keywords that *"all CSS properties can accept"*, see https://www.w3.org/TR/css-cascade-3/#defaulting-keywords

```TypeScript
type CSSWideKeyword = "initial" | "inherit" | "unset";
```

I've modified a few CSS properties to show how `CSSWideKeyword` should be used => currently most CSS properties are just ` any`.

```TypeScript
interface CSSProperties {
  // ...
  fontSizeAdjust?: CSSWideKeyword | "none" | number;
  fontStretch?: CSSWideKeyword |
                "normal" | "ultra-condensed" | "extra-condensed" | "condensed" | "semi-condensed" |
                "semi-expanded" | "expanded" | "extra-expanded" | "ultra-expanded";
  fontStyle?: CSSWideKeyword | "normal" | "italic" | "oblique";
  fontWeight?: CSSWideKeyword | "normal" | "bold" | "bolder" | "lighter" | 100 | 200 | 300 | 400 | 500 | 600 | 700 | 800 | 900;
  // ...
}
```

Also adds types [`CSSPercentage` (`string`)](https://drafts.csswg.org/css-values-3/#percentages) and [`CSSLength` (`number | string`)](https://drafts.csswg.org/css-values-3/#lengths).
